    "2015-09-01T18:24:12.681013",nt"name": "state-of-origin-for-usda-foods-in-fiscal-year-2012",nt"isopen":
    true,nt"url": null,nt"notes": "The Food and Nutrition Service (FNS) Food
    Distribution Programs provide food and nutrition assistance to school children and
    families and support American agriculture by distributing high quality, 100 percent
    American-grown USDA Foods. This report analyzes State of origin data for Fiscal
    Year (FY) 2012, which captures the State where USDA purchased USDA Foods during
    FY 2012. In FY 2012, USDA purchased over 2 billion pounds of food, worth nearly
    $2 billion. Purchased USDA Foods included both raw food products such as meats,
    vegetables, and fruits, as well as finished food products like cereal, crackers,
    and pasta.",nt"license_title": "Creative Commons CCZero",nt"extras":
